import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

    componentDidMount(){
    const BASE_URL = 'https://api.spotify.com/v1/artists?ids=';
    const ids = '0oSGxfWSnnOXhD2fKuz2Gy,3dBVyJ7JuOMt4GE9607Qin,3TVXtAsR1Inumwj472S9r4';
    const URL = BASE_URL+ids;
    //spotify:artist:3sgAdiPhuvZrC1Di13TVbO
    const access_token ='BQCsaZcKdXPuqBB4QbVLa99Zw1q-AjenZqQheQRasXQ8O8ugULxnDLlbqplHiMBpFQ7Opo-P4D3rZRJIHI61JLM5KKbVzgvpxEjYVdBb7f_6plEFbUpPKiNnTaYIBviZagoZpW-N2hcDyeTQ0SbK-obXwLnmxqbcLU2_y4hApeHtbsx0CQc8iEJY,3sgAdiPhuvZrC1Di13TVbO';

    const myOptions = {
      method: 'GET',
      headers : {
        'Authorization': 'Bearer '+access_token
      },
      mode: 'cors',
      cache: 'default'
    }
    fetch(URL, myOptions)
    .then(res => res.json())
    .then(artists => console.log(artists))
    }

  render() {
    return (
      <div/>
    );
  }
}

export default App;
